export async function getVans() {

    const res = await fetch("/api/vans");
    if (!res.ok) {
        const error = new Error({ message: "failed to fetch vans", statusText: res.statusText, status: res.status });
        console.log(error.message)
        throw error;

    }

    const data = await res.json();
    return data.vans;
}
